svg.script:
let current = 0;
const frames = [];
window.addEventListener("load", () => {
    for (let i = 0; i < 180; i++) {
        frames.push(document.getElementById("frame" + i));
    }
    function loop() {
        frames.forEach(f => f.setAttribute("class", "frame"));
        frames[current].setAttribute("class", "frame active");
        current = (current + 1) % frames.length;
    }
    setInterval(loop, 60);
    loop();
});
